import React from 'react';
import './index.css';
import Cards from "./Project1/Cards";
import sData from  './Project1/cardLists';



    const App = ()=>{
        return (
            <>
            <h1 className='heading1'>Top Five MxPlayer Series</h1>

              <Cards  key={sData[0].key} 
                      srcImage={sData[0].srcImage} 
                      title={sData[0].title} 
                      typeTrend={sData[0].typeTrend}
                      />
            </>
        )
    }

    export default App;
